function Columns({index,data}) {
    console.log(index)
    console.log(data)
    Object.keys(data).forEach(function(key) {
        return <td>{data[key]}</td>
    })

}
export default class TableComponent extends React.Component {
    render() {
        return (
            <Col sm="12">

            </Col>
        );
    }
}
